import React from 'react';
import styled, { css } from 'styled-components';

const Container = styled.div`
    height:20px;
    width:30%;
    border:1px solid black;
    ${( { isSelected } ) => isSelected && css`
        background: red;
  `}`;

function Cell({selected, onSelect , value}){

    const onClick = value => () => {
        onSelect(value)
    };

    return (
        <Container isSelected={selected} onClick={onClick(value)}/>
    )
}

export default Cell;
